function Draw()
	--draw the particles
	for i,d in pairs(dust) do
		if OnScreen(d) then
			circ(d.x%240,d.y%136,d.r,d.c)
		end
	end
	--draw the player
	spr(p.idx+p.frm,p.x%240,p.y%136,8,1,p.flp)
	
end

----- Updates ------------------------

function Update()
	UpdatePlayer()
	Particles()
	DamageTiles()
	Collectiables()
	Trigger()
	Dead()
	ShakeScreen()
end

function UpdatePlayer()
	--applies physics to the player
	Physics(p,frict,1,grav)
	
	--applies collision to the player
	if Collide(p,7,7) then
		NewDust(p.x+4,p.y+7,2.5)
	--sfx(0)
	end
	
	--moves the player
	Move(p)
	--checks if the player is falling or going up
	CheckAnim(p)
	--animates the player
	p.anim(p)
	
	--reset all variables
	p.x,p.y=p.x%(240*8),p.y%(136*8)
	p.down=false
	p.anim=a_idle
end

--updates the particles
function Particles()
	for i,d in pairs(dust) do
	--applies physics and movement
		Physics(d,.95,.95,0)
		Move(d)	
	--changes its color overtime
		if d.t<5 then
			d.c=3
		else
			d.c=10 
		end
		--when the timer ends, gets tiny and then deleted
		d.t=d.t-1+rnd()
		if d.t<1 then
			d.r=d.r/1.1
		end
		if d.r<1 then
			del(dust,i) 
		end
	end
end

--applies an objects velocity to its position
function Move(o)
	o.x=o.x+o.vx
	o.y=o.y+o.vy 
end
		
--applies friction and gravity on an object
function Physics(o,frictX,frictY,grav)
	o.vx=o.vx*frictX
	o.vy=o.vy*frictY
	o.vy=o.vy+grav 
	o.vy=min(max(o.vy,-3),3)
end

--checks if something is on the same map area of the player
function OnScreen(o)
	return p.x//240==o.x//240 and p.y//136==o.y//136
end

--checks if an object is in the air to apply the right animation
function CheckAnim(o)
	if o.vy>0 then
		o.anim=a_fall
	elseif o.vy<0 then
		o.anim=a_jump 
	end
end

--creates 10 new dust particles and put the in the dust list
function NewDust(x_,y_,r_)
	for i=0,10 do
		table.insert(dust,{
		x=x_,
		y=y_,
		vx= cos(rnd(30))/2,
		vy= -sin(rad(rnd(180)))*(rnd()*2)/5,
		r=rnd()*r_,
		t=r_*5
		})
	end
end

--[[stop an object of passing through blocks
and returns true if it just hit the ground]]
function Collide(o,w,h)
	local r=false
 local x,vx,y,vy=o.x,o.vx,o.y,o.vy
	
	if fget(mget((x+vx)//8,(y)//8),0) or 
			 fget(mget((x+vx)//8,(y+h)//8),0)	or
				fget(mget((x+vx+w)//8,(y)//8),0) or 
				fget(mget((x+vx+w)//8,(y+h)//8),0) then
					o.vx=0
	end

	local vx=o.vx
	
 if fget(mget((x+vx)//8,(y+vy)//8),0) or
   	fget(mget((x+vx+w)//8,(y+vy)//8),0) or
				fget(mget((x+vx)//8,(y+vy+h)//8),0) or
	   fget(mget((x+vx+w)//8,(y+vy+h)//8),0) then
			if o.vy > .6 then
				r=true
			end 
			o.vy=0
	end

 if fget(mget((x+vx)//8,(y+vy)//8),1) or
   	fget(mget((x+vx+w)//8,(y+vy)//8),1) or
				fget(mget((x+vx)//8,(y+vy+h)//8),1) or
	   fget(mget((x+vx+w)//8,(y+vy+h)//8),1) then
			if o.vy > .6 then
				r=false
			end
			if p.hasBall==true then
				o.vy=-2.75
				sfx(7,'A-3',5)
			else
				o.vy=0
			end
	end

	if fget(mget((x+vx)//8,(y+vy)//8),2) or
   	fget(mget((x+vx+w)//8,(y+vy)//8),2) or
				fget(mget((x+vx)//8,(y+vy+h)//8),2) or
	   fget(mget((x+vx+w)//8,(y+vy+h)//8),2) then
			if o.vy > .6 then
				r=true
			end 
			if p.hasBall==true then
				o.vy=-4
				sfx(7,'A-3',5)
			else
				o.vy=0
			end
	end
	
	--checks if the object is on the ground
	if fget(mget(x//8,(y+h+1)//8),0) or
				fget(mget((x+w)//8,(y+h+1)//8),0) or
				fget(mget(x//8,(y+h+1)//8),1) or
				fget(mget((x+w)//8,(y+h+1)//8),1) or
				fget(mget(x//8,(y+h+1)//8),2) or
				fget(mget((x+w)//8,(y+h+1)//8),2) then
					o.grnd = true else
					o.grnd = false
	end
		
	--checks if the object is below something
	if fget(mget(x//8,(y-1)//8),0) or
				fget(mget((x+w)//8,(y-1)//8),0) or
				fget(mget(x//8,(y-1)//8),1) or
				fget(mget((x+w)//8,(y-1)//8),1) or
				fget(mget(x//8,(y-1)//8),2) or
				fget(mget((x+w)//8,(y-1)//8),2) then
					o.ceil = false else
					o.ceil = true
	end
	
	return r
	
end
	
----- Controls -----------------------

--if an object can jump, jump
function CJump(o)
	if not gameOver or youWon then
		if o.grnd and o.ceil then
			sfx(00,'c-5',15)
			p.takeDmg=true
			if mget(p.x//8,p.y//8)==s.water or mget(p.x//8,p.y//8)==s.dwater then
				inWater=true
			end
			
			if inWater==true then
				o.mvup=-3
			 o.vy=o.mvup
			else
				o.mvup=-2
				o.vy=o.mvup
			end
			inWater=false
		end
	end
end

--crounching
function CDown(o)
	o.anim=a_down
	o.down=true
end

--goes left
function CLeft(o)
	o.vx=o.vx-o.mv 
	o.flp=1 
	o.anim=a_walk
end

--goes right
function CRight(o)
	o.vx=o.vx+o.mv
	o.flp=0
	o.anim=a_walk
end

----- Animations ---------------------

function a_idle(o)
	o.frm=0
end
		
function a_walk(o)
	if t%14==0 then --controls frame speed
		o.frm=o.frm+1
	end
 
	if o.frm<1 or o.frm>3 then
		o.frm=2
	end
end

function a_down(o)
	o.frm=7
end

function a_jump(o)
	o.frm=5
end

function a_fall(o)
	o.frm=6 
end

function DamageTiles()
	--spikes
	if mget(p.x//8,p.y//8)==s.spikes and p.takeDmg==true then
		p.currentHP=p.currentHP-1
		p.takeDmg=false
		sfx(09,'F-3',5)
		screenShake.active=true
	end
	--[[
	if mget(p.x//8,p.y//8+1)==s.dmgTile and p.takeDmg==true then
		p.currentHP=p.currentHP-1
		p.takeDmg=false
	end]]
end

function Trigger()
	if mget(p.x//8,p.y//8)==s.trigger then
		intro=false
	end
end

function Dead()
	if p.currentHP<=0 then
		gameOver=true
	end
end

----- Interactives ---------------------

function Collectiables()
	--[[See if a tile has an object and replace it with
	an empty tile]]
	--coins
	if mget(p.x//8,p.y//8)==s.coin then
		mset(p.x//8,p.y//8,s.empty)
		p.coins=p.coins+1
		sfx(01,'E-6',5)
	end
	--coin bag
	if mget(p.x//8,p.y//8)==s.coinBag then
		mset(p.x//8,p.y//8,s.empty)
		p.coins=p.coins+10
		sfx(08,'B-3',25)
	end
	--heart
	if mget(p.x//8,p.y//8)==s.heart and p.currentHP~=p.maxHP then
		mset(p.x//8,p.y//8,s.empty)
		p.currentHP=p.maxHP
		sfx(02,'E-4',8)
	end
	--bone
	if mget(p.x//8,p.y//8)==s.bone then
		if p.bones<3 then 
			p.bones=p.bones+1
			mset(p.x//8,p.y//8,s.empty)
		end
		if p.bones==3 and p.currentHP~=p.maxHP then
			p.currentHP=p.currentHP+1
			p.bones=0
		elseif p.bones>=3 and p.currentHP~=p.maxHP then
			p.currentHP=p.currentHP+1
			p.bones=1
		end
		sfx(04,'E-2',10)
	end
	--Ball
	if mget(p.x//8,p.y//8)==s.ball then
		mset(p.x//8,p.y//8,s.empty)
		p.hasBall=true
		sfx(05,'B-5',10)
	end
	--Keys
	if mget(p.x//8,p.y//8)==s.dkey and p.hasKey~=3 then
		mset(p.x//8,p.y//8,s.empty)
		p.hasKey=p.hasKey+1
		sfx(03,'B-6',8)
	end
	--Idol
	if mget(p.x//8,p.y//8)==s.idol then
		mset(p.x//8,p.y//8,s.empty)
		p.idolKey=true
		sfx(03,'B-7',10)
	end
	--Door Right
	if mget(p.x//8+1,p.y//8)==s.doorR and p.hasKey>=1 then
		mset(p.x//8+1,p.y//8,126)
		p.hasKey=p.hasKey-1
		sfx(06,'B-2',3)
	end
	--Door Left
	if mget(p.x//8-1,p.y//8)==s.doorL and p.hasKey>=1 then
		mset(p.x//8-1,p.y//8,142)
		p.hasKey=p.hasKey-1
		sfx(06,'B-2',3)
	end
	--Gold door
	if mget(p.x//8+1,p.y//8)==s.gDoor and p.idolKey==true then
		mset(p.x//8+1,p.y//8,173)
		p.idolKey=false
		sfx(06,'B-2',3)
	end
	--Gold bone
	if mget(p.x//8,p.y//8)==s.gbone then
		youWon=true
		--sfx(06,'B-2',3)
	end
end

